import React from "react";

const DeliveryPointsInput = ({ deliveryPoints }) => {
  return (
    <div>
      <h3 className="text-lg font-semibold text-gray-800 mb-2">Delivery Points</h3>
      {deliveryPoints.length > 0 ? (
        <ul className="list-disc list-inside text-sm text-gray-600">
          {deliveryPoints.map((point, index) => (
            <li key={index}>
              Latitude: {point.lat}, Longitude: {point.lng}
            </li>
          ))}
        </ul>
      ) : (
        <p className="text-sm text-gray-600">Click on the map to add delivery points.</p>
      )}
    </div>
  );
};

export default DeliveryPointsInput;
